import React from 'react';
import { useNavigate, useParams } from 'react-router-dom';

const ProductDetailsWrapper = () => {
  const navigate = useNavigate();
  const { productId } = useParams();

  return <ProductDetails productId={productId} navigate={navigate} />;
};

class ProductDetails extends React.Component {
  componentDidMount() {
    // Access this.props.productId for product ID
    const { productId } = this.props;
    // You can use this.props.navigate for navigation
  }

  render() {
    return (
      <div>
        <h1>Product Details</h1>
        <p>Product ID: {this.props.productId}</p>
        <button onClick={() => this.props.navigate('/products')}>Go to Products</button>
      </div>
    );
  }
}

export default ProductDetailsWrapper;
